* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html, body, #root {
  width: 100%;
  height: 100%;
  overflow: hidden;
}

.react-flow-container {
  width: 100vw;
  height: 100vh;
  background: #f9fafb;
}

/* Custom handle styles */
.react-flow__handle {
  width: 12px;
  height: 12px;
  background: #86efac;
  border: 2px solid white;
}

.react-flow__handle-right {
  background: #86efac;
}

.react-flow__handle-left {
  background: #86efac;
}

/* Edge label styles */
.react-flow__edge-label {
  font-size: 11px;
  font-weight: 600;
  background: white;
  padding: 2px 8px;
  border-radius: 4px;
  border: 1px solid #e5e7eb;
}
